import React from "react";
import styled from "styled-components";
import "../style.js";
import { useNavigate } from "react-router-dom";
import { Button } from "../style.js";

const Header = (props) => {
    const navigate = useNavigate();

    const goMainPage = () => {
        navigate("/");
    };
    const goSignUpPage = () => {
        navigate("/signup");
    };
    const goSignInPage = () => {
        navigate("/signin");
    };
    const goSignOutPage = () => {
        navigate("/signout");
    };
    const goMyPage = () => {
        navigate("/mypage");
    };
    const goUserListPage = () => {
        navigate("/userlist");
    };

    const goRoomPage = function() {
        // navigate("/roompage");
    };

    function goGatherRoomPage() {
        navigate("/gatherroompage");
    }
    return (
        <Container>
            <Logo onClick={goMainPage}>
                <img src="logo.svg" alt="logo" />
                <p>모두의 마피아</p>
            </Logo>
            <Menu>
                <Button onClick={goSignUpPage}>회원가입</Button>
                <Button onClick={goSignInPage}>로그인</Button>
                <Button onClick={goSignOutPage}>로그아웃</Button>
                <Button onClick={goMyPage}>마이페이지</Button>
                <Button onClick={goUserListPage}>유저 관리</Button>
                <Button onClick={goRoomPage}>대기실</Button>
                <Button onClick={goGatherRoomPage}>게더룸</Button>
            </Menu>
        </Container>
    );
};

const Logo = styled.a`
    display: flex;
    flex-direction: row;
    cursor: pointer;

    img {
        display: block;
        width: 40px;
    }
    p {
        color: var(--color-2);
        font-size: 20px;
    }
`;

const Container = styled.section`
    overflow: hidden;
    display: flex;
    flex-direction: row;
    text-align: center;
    justify-content: space-between;
    align-items: center;

    padding: 0 40px 0 40px;
    height: 60px;
    background-color: var(--color-5);
`;

const Menu = styled.section`
    overflow: hidden;
    display: flex;
    flex-direction: row;
    align-items: center;
`;

export default Header;
